class RewardsAndTutorial extends Component{
    render(){
        return(
            <div>
                <div className="rewardsDiv">
                    <div className="rewardsImgDiv">
                        <img className="rewardsImg" src={rank}></img>
                    </div>
                    <div className="rewardsText">
                        <p className="rewardsTitle"></p>
                        <p className="rewardsDesc"></p>
                    </div>
                </div>
            </div>
        );
    }
}

export default RewardsAndTutorial
